// Primitives as objects:
// Single primitive types (integers, floating points, character) are wrapped inside objects when accessed as an object.
// Arrays, NNumber, NChar, NVector and NString are not primitive types and are therefore not wrapped.
console.log(2 instanceof NNumber); // false
console.log(2.1 instanceof NNumber); // false
console.log('c' instanceof NChar); // false
console.log(new NNumber(2)); // { value: 2, ... }
console.log(new NNumber(2.1)); // { value: 2.1, ... }
console.log(new NChar('c')); // { char: c, ... }


// Custom Singleton Objects:
// e.g. By accessing (static) members of the declared NIter, NStr, NArrayist all singletons are instantiated if not already.
console.log(NIter); // { iterableVariants: [], ... }
console.log(NStr); // { stringVariants: [], ... }
console.log(NArray); // { arrayVariants: [], ... }


// Note:Primitive/default Objects (methods) are declared as static members.
// e.g. NString, NChar, NNumber, NVector and NArray wrap increasing number of primitives, e.g. NString extends from NChar and NChar extends from NNumber.
console.log(NNumber.integerVariants); // [ 1, 2, 20, ... ]
console.log(NNumber.longIntegerVariants); // [ -Infinity, Infinity, 10, -10, ... ]
console.log(NNumber.integer64Variants); // [ 5, -5, -1231254, 90874569564 ]
console.log(NChar.characterVariants); // [ a, b, c, d, ... ]
console.log(NChar.hexVariants); // [ '\x63', '\xff', '\xab', '\x00', ... ]
console.log(NString.unicodeVariants); // [ '\u0066', ... ]


// Interface validation against types
// e.g. An <IMap<String, IList<Number>>> and an <IMap<Number, List<Number>>> are invalid.
// However, an <IMap<String, IList<String>>> is valid and a <IMap<ARRAY, IList<NUMBER>>> should be too.
console.log('<IMap<String, IList<String>>>'.validInstance(new IMap({}), true)); // true
console.log(typeOf('<IMap<String, IList<String>>>').validInstance(new IMap({})), true); // true
console.log(typeOf('<IMap<String, IList<String>>>').validInstance({}, true)); // false
console.log(typeOf('<IMap<ARRAY, IList<NUMBER>>>').validInstance({}, true)); // false
console.log(typeOf('<IMap<ARRAY, IList<NUMBER>>>').validInstance(new IMap({}), true)); // true
console.log(typeOf('<IMap<String, IList<Number>>>').validInstance(new IMap({}), true)); // false
console.log(typeOf('<IMap<String, IList<Number>>>').validInstance(new IMap({}), true)); // false
